import logo from './logo.svg';
import './App.css';
import { SignIn } from './components/SignIn/SignIn';
import { SignUp } from './components/SignUp/SignUp';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
            <main>
              <Routes>
                <Route path='/' element={<SignIn/>}/>
              </Routes>
            </main>
        </BrowserRouter>
    </div>
  );
}

export default App;
